import {gql} from 'apollo-boost'
import {graphql} from 'react-apollo';


const getEmpresas= 
gql`
{
  empresas{
    nombre,
    distrito,
    correo,
    canton,
    provincia
    }
  }
  `;

const ADD_BOOK = 
gql`
mutation addEmpresa{ 
  addListing(
    nombre:String!,
  distrito: String!,
  correo: String!,
  provincia:String!,
  canton:String!,
  ){
    nombre,distrito,correo,provincia,canton
  }
}
`;

  export default (getEmpresas);
